Опыт работы в IT-сфере более 20 лет, более 15 лет в качестве руководителя и владельца компаний;
• Опыт успешно реализованных проектов по построению и модернизации корпоративных информационных систем, систем информационной безопасности, систем промышленной автоматизации, а также по технической поддержке информационных, телекоммуникационных и инженерных систем. Данные проекты находят широкое применение не только во Владимире и Владимирской области, но и за пределами региона. Программные продукты компании внедрены в 6 регионах РФ. Количество заказчиков более 2000;
• Координатор цифровой трансформации региона, постоянный участник рабочих групп ОИВ и совета по информатизации при губернаторе области,  а также стратегических сессий по вопросам реализации национальных проектов;  
• За время трудовой деятельности в разных должностях неоднократно награждался почётными грамотами и благодарственными письмами, в том числе «за многолетний добросовестный труд, значительный личный вклад в развитие отрасли связи, информационных и коммуникационных технологий Владимирской области» (2022)
